  \"fy-1994-endangered-species-recovery-activities-on-st-vincentnational-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"St. Vincent NWR received endangered species
  recovery funds 1113 for the red wolf 25,000 and sea turtles 3,000 in. FY 1994. The
  refuge also hosted nesting and wintering southern bald eagles, a population of indigo
  snakes, migratory peregrine falcons, piping plovers, and wood storks, and several
  candidate species of plants and animals. All were monitored on a regular basis and
  protection was provided for them with refuge funds.\",\n\t\"license_title\": \"License
